import React from "react";
import { Transition } from "react-transition-group";

import "./Hall.css";

const Hall = props => {
	return (
		<Transition timeout={800} in={true} appear={true} mountOnEnter>
			{status => (
				<main
					className={`side-wrapper-animated flex bg-black pageTransition-${status}`}
				>
					<div className={`textTransition-${status}`}>
						<h3>
							Hall <span>of</span> Fame
						</h3>
						"John Snow Bandeira", "Cersei de Jesus", "White Walker da Silva",
						"Ayra dos Santos"
					</div>
				</main>
			)}
		</Transition>
	);
};

export default Hall;
